import React, { Component } from 'react'

class Anime extends Component {
    render() {
        const { title, release, genre, episodes, likes } = this.props;
        return (
            <div>
                <h4>{ title }</h4>
                <p>{ genre } </p>
                <p>{ episodes } </p>
                <p>Yea{ release } </p>
                <button> Likes { likes } </button>
            </div>
        )
    }
}

export default Anime
